Uploaded as a mark of respect. RIP Joe Frazier.

Original broadcasts of Joe Frazier Vs Muhammad Ali II &amp; III.

No annoying logos, etc. Original commentary.

This disk was NOT taken from a career set.

Quality is very good considering the age. In my opinion this is a high quality VHS to DVD transfer. Quality is better than the screenshots suggest:



